(432, 'Homestay Quang Ninh Jul 03', 1, 50, '1963500.000', 2, 0, 'Một căn hộ tươi sáng, mơ mộng và rộng rãi, ở trong một con hẻm địa phương xinh đẹp, cách đại lộ Lê Duẩn, trung tâm quận1 vài bước chân. Không gian độc đáo này rất tuyệt vời cho bạn bè và gia đình muốn dành một kỳ nghỉ chất lượng ở trung tâm thành phố. Chúng tôi đang ở trung tâm của quận1, mất khoảng5 phút đi bộ đến bưu điện, sở thú, Bảo tàng Lịch sử, Nhà thờ Đức Bà, ... Chúng tôi chào đón bạn bằng cách trung thực và dịch vụ của chúng tôi. Xin vui lòng, đến, thưởng thức và chia sẻ ý kiến ​​của bạn!\n\n\n\nĐịa điểm của chúng tôi là tốt nhất cho:\n\n\n\n1. Nhóm khách du lịch, khách doanh nhân\n\n2. Gia đình thích ở trong một không đông đúc nhưng trung tâm của Quận1\n\n3. Những người có thời gian giới hạn nhưng chắc chắn muốn tận hưởng những trải nghiệm tiêu biểu nhất của Sài Gòn.\n\n4. Mọi người thích không gian tươi sáng, đầy ánh nắng với màu sắc mùa hè!\n\n\n\nNơi này nằm trên tầng1, sẽ đưa bạn lên cầu thang1 nhưng bạn sẽ sớm cảm thấy không hối hận khi nhìn thấy nó. Đây là căn hộ có2 phòng ngủ với2 phòng', 'Một căn hộ tươi sáng, mơ mộng và rộng rãi, ở trong một con hẻm địa phương xinh đẹp, cách đại lộ Lê Duẩn, trung tâm quận1 vài bước chân. Không gian độc đáo này rất tuyệt vời cho bạn bè và gia đình muốn dành một kỳ nghỉ chất lượng ở trung tâm thành phố. Chúng tôi đang ở trung tâm của quận1, mất khoảng', 'Phường Bãi Cháy Thành Phố Hạ Long, Hùng Thắng, Thành phố Hạ Long, Quản', 330525),
(433, 'The Old and New House, 30s to Opera', 1, 50, '877800.000', 2, 0, 'Căn hộ của chúng tôi nằm trên tầng 2 của tòa chung cư cổ tại Hà Nội - Căn hộ có 1 phòng ngủ chính, phòng đọc, phòng ngủ, phòng khách, bếp và ban công được thiết kế theo phong cách truyền thống Hà Nội .\nCăn hộ này chỉ cách Nhà hát Lớn Hà Nội, khách sạn 5 sao Metropole, hồ Hoàn Kiếm, chợ Đồng Xuân, Con đường gốm sứ vài bước chân, rất tiện lợi cho khách du lịch đến thăm Hà Nội.\n\nKhông gian\n\nNgôi nhà ấm cúng của chúng tôi có trần nhà cao, nhiều cửa sổ và tràn ngập ánh sáng tự nhiên. Bước vào nhà bếp đáng yêu, chúng tôi cung cấp đầy đủ tiện nghi (tủ lạnh, bếp điện, nồi v.v) để bạn có thể nấu các món ăn đơn giản. 2 phòng ngủ với 2 giường cỡ queen đều hướng về ban công ấm cúng của chúng tôi.\n\nCác lưu ý khác\n\nBạn có thể giữ cho căn hộ xanh tươi bằng cách giúp chúng tôi tưới cây vào buổi sáng (trước 11 giờ sáng) hoặc chiều (sau 4 giờ chiều). Chúng tôi sẽ rất cảm ơn bạn điều đó.', 'Căn hộ của chúng tôi nằm trên tầng 2 của tòa chung cư cổ tại Hà Nội - Căn hộ có 1 phòng ngủ chính, phòng đọc, phòng ngủ, phòng khách, bếp và ban công được thiết kế theo phong cách truyền thống Hà Nội .\nCăn hộ này chỉ cách Nhà hát Lớn Hà Nội, khách sạn 5 sao Metropole, hồ Hoàn Kiếm, chợ Đồng Xuân, Co', '35 Tràng Tiền, Hoàn Kiếm, Hà Nội, Vietnam', 40251),
