(435, 'Palace homestay ', 1, 50, '500000.000', 4, 0, 'Palace homestay là 1 homestay nhỏ xinh tại thành phố Hồ Chí Minh. Hãy đến để cảm nhận điều tuyệt vời nhất', 'Palace homestay là 1 homestay nhỏ xinh tại thành phố Hồ Chí Minh.', 'FDR Drive, New York, NY, USA', 1015150087),
(436, ' Xin chào Huyen xinh', 1, 50, '500000.000', 2, 0, 'Xin chào Huyen xinh, hãy bắt đầu tạo căn hộ cho thuê đầu tiên!\nXin chào Huyen xinh, hãy bắt đầu tạo căn hộ cho thuê đầu tiên!', 'Xin chào Huyen xinh, hãy bắt đầu tạo căn hộ cho thuê đầu tiên!', '22 Xuân La, Tây Hồ, Hà Nội, Vietnam', 40254),
