(441, ' An Bang Garden House - Lotus Room', 1, 50, '1386000.000', 2, 0, 'Du khách tới Quảng Nam chắc hẳn không thể không ghé thăm phố cổ Hội An, để thăm Chùa Cầu, mua đồ gốm Thanh Hà, ăn Cao Lầu hay Mỳ Quảng nổi danh…Để thực sự trải nghiệm và hòa cùng nhịp sống của người dân phố cổ, bạn nên tìm đến những căn homestay thay vì một khách sạn hay nhà nghỉ nào đó. Căn homestay trên đường Nguyễn Phan Vinh, Cẩm An – khu vực ven biển và là cửa ngõ phía Đông của Hội An sẽ là gợi ý cần thiết cho bạn.\n\nTọa lạc trong khuôn viên rộng rãi và biệt lập, những căn homestay cho 2 người vừa có được sự riêng tư, thoải mái, vừa đảm bảo yếu tố an ninh. Tại đây, bạn có thể lựa chọn thuê từng phòng riêng hoặc thuê nguyên căn nhà nếu muốn. Xung quanh nhà ở là không gian hồ nước, tiểu cảnh, sân vườn xanh mát với những loại cây hoa đặc trưng. Từ mọi căn phòng trong khu nhà, bạn đều có thể phóng tầm mắt nhìn ra cảnh quan thiên nhiên thơ mộng bên ngoài. Chúng tôi còn mang đến những bữa ăn sáng chất lượng cho khách nghỉ tại homestay, cũng như dịch vụ dọn dẹp và đưa đón sân bay theo yêu ', 'Du khách tới Quảng Nam chắc hẳn không thể không ghé thăm phố cổ Hội An, để thăm Chùa Cầu, mua đồ gốm Thanh Hà, ăn Cao Lầu hay Mỳ Quảng nổi danh…Để thực sự trải nghiệm và hòa cùng nhịp sống của người dân phố cổ, bạn nên tìm đến những căn homestay thay vì một khách sạn hay nhà nghỉ nào đó. Căn homesta', 'Xuân La, Tây Hồ, Hanoi, Vietnam', 254003656),
