(445, 'Tony tony chopper - peaceful beach', 2, 50, '500000.000', 1, 0, '\nMy Penthouse located on the twelveth floor with a large balcony, so you can enjoy a panorama ocean view. With 2 bedroom – 5 Beds and large living room, you can spend your vacation with your family or even big group of 8 peoples. The private beach, in general, is quite empty during weekdays and a little bit more people on the weekends. So that why you can enjoy your trip away from noisy downtown a. Even you are a group of friend, you can make camping or BBC on the beach. There are a FREE swimming pool, minimart, cafes, small park in this area. A minimart is on the ground floor. Restaurants and cafes are just about 3 minutes away from the resort, so you don\'t need to even go far to get delicious food.\n\n\n\nYou can access all shared facilities in the apartment: kitchen, dining area, living room, bathroom, washing machine, parking, elevator,...\n\n\n\nThe swimming pool nearby beach is already open for free with the kids swimming pool also.', 'Fall asleep to the sound of ocean waves in this charming beachfront apartment. The light, airy home features open-plan living and a wall of windows to maximize the amazing views. Enjoy drinks on your swing and a sunset over the water—it\'s truly relaxing.\n\n', 'Cau Dien, Từ Liêm, Hanoi, Vietnam', 26),
