(477, 'Nam Định Homestay', 1, 50, '500000.000', 1, 0, 'Nam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định Homestay', 'Nam Định HomestayNam Định HomestayNam Định HomestayNam Định HomestayNam Định Homestay', 'Nam Anh, Nam Đàn, Nghệ An, Vietnam', 426006481),
(478, 'Rooftop sea view apartment', 2, 50, '500000.000', 2, 0, 'Không khí thoải mái và sảng khoái với căn hộ trên tầng thượng nằm trên tầng 40 của tòa nhà Mường Thanh -Viên Triều.\n\nChỉ cần uống một tách trà/cà phê ở ban công tầng cao nhất của tòa nhà vào buổi sáng đầy nắng của mùa hè, bạn sẽ cảm nhận sự tự do tuyệt đối!\n\n\n\nHãy đến nhà Sophia và bạn sẽ trải nghiệm\n\n\n\nToàn bộ căn hộ sẽ là của bạn với đầy đủ các tiện nghi. Vào ban ngày, bạn có thể cảm nhận không khí trong lành từ biển đến phòng của bạn.\n\nNằm trên tầng cao nhất (thứ 40) của tòa nhà theo nghĩa đen ở phía trước bãi biển!\n\n\n\nBạn có thể tận hưởng bãi biển như một địa phương và khám phá cuộc sống địa phương\n\n\n\nTòa nhà nằm ở địa phương gần với tất cả các loại thực phẩm và chợ truyền thống\n\n\n\nMột số điểm tham quan trong thành phố mà bạn có thể thấy thú vị như:\n\n\n\nTháp Ponaga: 1,2 km\n\n\n\nChợ Đầm: 2,3km\n\n\n\nChủ nhà nghỉ mát mùa xuân I: 2,8km\n\n\n\nTrung tâm thương mại Nha Trang: 3km\n\n\n\nChùa Phật Sơn Long Sơn: 3,2km\n\n\n\nNhà thờ Thành phố: 3,3km', 'Không khí thoải mái và sảng khoái với căn hộ trên tầng thượng nằm trên tầng 40 của tòa nhà Mường Thanh -Viên Triều.', 'Bưởi, Tây Hồ, Hà Nội, Việt Nam', 254003650),
